import React, { useState, useEffect } from "react";
import { Modal, Button } from "antd";

const edit01 = props => {
  useEffect(() => {
    console.log("MODAL !!", props);
  }, []);

  return (
    <>
      <button> 뒤로가기 </button>
      <div>EDIT</div>
    </>
  );
};

export default edit01;
